import React from "react";
import "../../styles/Footer.css";

function Footer() {
return(    
<footer className="footer">
    <div className="bottom">Clicky Game! 
      <img alt="react" src="https://hdwallpaperim.com/wp-content/uploads/2017/08/25/461264-reactJS-Facebook-JavaScript-minimalism-artwork-simple_background.jpg"/>
    </div>
</footer>)
}

export default Footer;
